import React from 'react';
import './LandingPage.css';

function ContactPage() {
  return (
    <div className="d-flex justify-content-center align-items-center" style={{minHeight: '80vh', background: 'linear-gradient(120deg, #e8f5e9 60%, #f1f8e9 100%)'}}>
      <div className="contact-card p-4" style={{background: '#fff', borderRadius: '1.2rem', boxShadow: '0 4px 24px 0 rgba(76, 175, 80, 0.10)', border: '1.5px solid #c8e6c9', maxWidth: 420, width: '100%'}}>
        <h2 className="mb-3" style={{color: '#204d2a', fontWeight: 700, fontFamily: 'Montserrat, sans-serif'}}>Contact</h2>
        <div className="mb-3">
          <span style={{fontWeight: 600, color: '#388e3c'}}>Name:</span> Devi Sri Prasad
        </div>
        <div className="mb-3">
          <span style={{fontWeight: 600, color: '#388e3c'}}>Email:</span> <a href="mailto:doladevisriprasad050505@gmail.com" style={{color: '#204d2a', textDecoration: 'underline'}}>doladevisriprasad050505@gmail.com</a>
        </div>
        <div className="mb-3">
          <span style={{fontWeight: 600, color: '#388e3c'}}>Phone:</span> <a href="tel:9515821645" style={{color: '#204d2a', textDecoration: 'underline'}}>9515821645</a>
        </div>
        <div>
          <span style={{fontWeight: 600, color: '#388e3c'}}>LinkedIn:</span> <a href="https://www.linkedin.com/in/dola-devi-sri-prasad-301a50315/" target="_blank" rel="noopener noreferrer" style={{color: '#204d2a', textDecoration: 'underline'}}>dola-devi-sri-prasad</a>
        </div>
      </div>
    </div>
  );
}

export default ContactPage;
